import React, { Component } from "react";

export default class ProfileContainer extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: this.props.name,
      email: this.props.email,
      created_on: this.props.created_on
    };
  }

  render() {
    return (
      <React.Fragment>
        <p>{this.state.name}</p>
      </React.Fragment>
    );
  }
}
